import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { toast } from 'react-toastify';

const Cars = () => {
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');
  const [filterColor, setFilterColor] = useState('');

  useEffect(() => {
    fetchCars();
  }, []);

  const fetchCars = async () => {
    try {
      setLoading(true);
      const response = await axios.get('/api/cars');
      setCars(response.data);
    } catch (error) {
      console.error('Error fetching cars:', error);
      toast.error('Failed to load cars');
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (carId, carName) => {
    if (window.confirm(`Are you sure you want to delete ${carName}? This action cannot be undone.`)) {
      try {
        await axios.delete(`/api/cars/${carId}`);
        setCars(cars.filter(car => car._id !== carId));
        toast.success('Car deleted successfully');
      } catch (error) {
        console.error('Error deleting car:', error);
        toast.error('Failed to delete car');
      }
    }
  };

  const formatDate = (date) => {
    return new Date(date).toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'short',
      day: 'numeric'
    });
  };

  const filteredCars = cars.filter(car => {
    const matchesSearch = car.make.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         car.model.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         car.licensePlate.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesColor = !filterColor || car.color.toLowerCase() === filterColor.toLowerCase();
    return matchesSearch && matchesColor;
  });

  const uniqueColors = [...new Set(cars.map(car => car.color))];

  if (loading) {
    return (
      <div style={{
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        minHeight: '400px',
        background: '#f8fafc'
      }}>
        <div style={{
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          gap: '1rem'
        }}>
          <div className="spinner" style={{ width: '40px', height: '40px' }}></div>
          <p style={{ color: '#64748b' }}>Loading your car collection...</p>
        </div>
      </div>
    );
  }

  return (
    <div style={{
      background: '#f8fafc',
      minHeight: '100vh',
      padding: '2rem 0'
    }}>
      <div className="container" style={{
        maxWidth: '1200px',
        margin: '0 auto',
        padding: '0 1.5rem'
      }}>
        {/* Header */}
        <div style={{
          display: 'flex',
          flexDirection: 'column',
          gap: '1.5rem',
          marginBottom: '2rem'
        }}>
          <div style={{
            display: 'flex',
            flexDirection: 'column',
            gap: '0.5rem'
          }}>
            <h1 style={{
              fontSize: '2.5rem',
              fontWeight: '700',
              color: '#0f172a',
              background: 'linear-gradient(135deg, #2563eb 0%, #1d4ed8 100%)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              backgroundClip: 'text'
            }}>
              My Car Collection
            </h1>
            <p style={{
              fontSize: '1.125rem',
              color: '#64748b'
            }}>
              Manage and track your vehicles
            </p>
          </div>

          {/* Search and Filter */}
          <div style={{
            display: 'flex',
            flexDirection: 'column',
            gap: '1rem',
            background: 'white',
            padding: '1.5rem',
            borderRadius: '0.75rem',
            boxShadow: '0 4px 6px -1px rgba(0, 0, 0, 0.1)',
            border: '1px solid #e2e8f0'
          }}>
            <div style={{
              display: 'flex',
              flexDirection: 'column',
              sm: 'flex-row',
              gap: '1rem',
              alignItems: 'stretch'
            }}>
              <div style={{ flex: 1 }}>
                <input
                  type="text"
                  placeholder="Search cars by make, model, or license plate..."
                  value={searchTerm}
                  onChange={(e) => setSearchTerm(e.target.value)}
                  style={{
                    width: '100%',
                    padding: '0.75rem 1rem',
                    border: '2px solid #e2e8f0',
                    borderRadius: '0.5rem',
                    fontSize: '0.875rem',
                    transition: 'all 0.2s ease'
                  }}
                  onFocus={(e) => {
                    e.target.style.borderColor = '#2563eb';
                    e.target.style.boxShadow = '0 0 0 3px rgba(37, 99, 235, 0.1)';
                  }}
                  onBlur={(e) => {
                    e.target.style.borderColor = '#e2e8f0';
                    e.target.style.boxShadow = 'none';
                  }}
                />
              </div>
              <div style={{ minWidth: '200px' }}>
                <select
                  value={filterColor}
                  onChange={(e) => setFilterColor(e.target.value)}
                  style={{
                    width: '100%',
                    padding: '0.75rem 1rem',
                    border: '2px solid #e2e8f0',
                    borderRadius: '0.5rem',
                    fontSize: '0.875rem',
                    background: 'white',
                    cursor: 'pointer',
                    transition: 'all 0.2s ease'
                  }}
                  onFocus={(e) => {
                    e.target.style.borderColor = '#2563eb';
                    e.target.style.boxShadow = '0 0 0 3px rgba(37, 99, 235, 0.1)';
                  }}
                  onBlur={(e) => {
                    e.target.style.borderColor = '#e2e8f0';
                    e.target.style.boxShadow = 'none';
                  }}
                >
                  <option value="">All Colors</option>
                  {uniqueColors.map(color => (
                    <option key={color} value={color}>{color}</option>
                  ))}
                </select>
              </div>
              <Link
                to="/cars/add"
                className="btn btn-primary"
                style={{
                  padding: '0.75rem 1.5rem',
                  fontSize: '0.875rem',
                  fontWeight: '600',
                  whiteSpace: 'nowrap'
                }}
              >
                ➕ Add New Car
              </Link>
            </div>
          </div>
        </div>

        {/* Cars Grid */}
        {filteredCars.length === 0 ? (
          <div style={{
            textAlign: 'center',
            padding: '4rem 2rem',
            background: 'white',
            borderRadius: '0.75rem',
            boxShadow: '0 4px 6px -1px rgba(0, 0, 0, 0.1)',
            border: '1px solid #e2e8f0'
          }}>
            <div style={{
              fontSize: '4rem',
              marginBottom: '1.5rem'
            }}>
              {searchTerm || filterColor ? '🔍' : '🚗'}
            </div>
            <h3 style={{
              fontSize: '1.5rem',
              fontWeight: '600',
              color: '#0f172a',
              marginBottom: '0.5rem'
            }}>
              {searchTerm || filterColor ? 'No cars found' : 'No cars yet'}
            </h3>
            <p style={{
              color: '#64748b',
              marginBottom: '2rem',
              maxWidth: '400px',
              margin: '0 auto 2rem'
            }}>
              {searchTerm || filterColor 
                ? 'Try adjusting your search or filter criteria'
                : 'Start building your car collection by adding your first vehicle'
              }
            </p>
            <Link to="/cars/add" className="btn btn-primary">
              {searchTerm || filterColor ? 'Clear Filters' : 'Add Your First Car'}
            </Link>
          </div>
        ) : (
          <div style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(auto-fill, minmax(350px, 1fr))',
            gap: '1.5rem'
          }}>
            {filteredCars.map((car) => (
              <div key={car._id} style={{
                background: 'white',
                borderRadius: '0.75rem',
                boxShadow: '0 4px 6px -1px rgba(0, 0, 0, 0.1)',
                border: '1px solid #e2e8f0',
                overflow: 'hidden',
                transition: 'all 0.3s ease',
                cursor: 'pointer'
              }}
              onMouseEnter={(e) => {
                e.currentTarget.style.transform = 'translateY(-4px)';
                e.currentTarget.style.boxShadow = '0 20px 25px -5px rgba(0, 0, 0, 0.1), 0 10px 10px -5px rgba(0, 0, 0, 0.04)';
              }}
              onMouseLeave={(e) => {
                e.currentTarget.style.transform = 'translateY(0)';
                e.currentTarget.style.boxShadow = '0 4px 6px -1px rgba(0, 0, 0, 0.1)';
              }}
              >
                {/* Car Image */}
                <div style={{
                  height: '200px',
                  background: 'linear-gradient(135deg, #f1f5f9 0%, #e2e8f0 100%)',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  position: 'relative',
                  overflow: 'hidden'
                }}>
                  {car.image ? (
                    <img
                      src={car.image}
                      alt={`${car.make} ${car.model}`}
                      style={{
                        width: '100%',
                        height: '100%',
                        objectFit: 'cover',
                        transition: 'transform 0.3s ease'
                      }}
                      onError={(e) => {
                        e.target.style.display = 'none';
                        e.target.nextSibling.style.display = 'flex';
                      }}
                    />
                  ) : null}
                  <div style={{
                    display: car.image ? 'none' : 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    fontSize: '4rem',
                    color: '#94a3b8'
                  }}>
                    🚗
                  </div>
                  <div style={{
                    position: 'absolute',
                    top: '0.75rem',
                    right: '0.75rem',
                    background: 'rgba(255, 255, 255, 0.9)',
                    padding: '0.25rem 0.75rem',
                    borderRadius: '9999px',
                    fontSize: '0.75rem',
                    fontWeight: '600',
                    color: '#475569'
                  }}>
                    {car.year}
                  </div>
                </div>

                {/* Car Details */}
                <div style={{ padding: '1.5rem' }}>
                  <div style={{
                    display: 'flex',
                    alignItems: 'flex-start',
                    justifyContent: 'space-between',
                    marginBottom: '1rem'
                  }}>
                    <div>
                      <h3 style={{
                        fontSize: '1.25rem',
                        fontWeight: '700',
                        color: '#0f172a',
                        marginBottom: '0.25rem'
                      }}>
                        {car.make} {car.model}
                      </h3>
                      <div style={{
                        display: 'flex',
                        alignItems: 'center',
                        gap: '0.5rem'
                      }}>
                        <div style={{
                          width: '12px',
                          height: '12px',
                          borderRadius: '50%',
                          background: car.color.toLowerCase() === 'red' ? '#ef4444' :
                                     car.color.toLowerCase() === 'blue' ? '#3b82f6' :
                                     car.color.toLowerCase() === 'black' ? '#1f2937' :
                                     car.color.toLowerCase() === 'white' ? '#f3f4f6' :
                                     car.color.toLowerCase() === 'silver' ? '#9ca3af' :
                                     car.color.toLowerCase() === 'gray' ? '#6b7280' :
                                     car.color.toLowerCase() === 'green' ? '#10b981' :
                                     car.color.toLowerCase() === 'yellow' ? '#f59e0b' :
                                     '#94a3b8',
                          border: '2px solid #e2e8f0'
                        }}></div>
                        <span style={{
                          fontSize: '0.875rem',
                          color: '#64748b',
                          fontWeight: '500'
                        }}>
                          {car.color}
                        </span>
                      </div>
                    </div>
                  </div>

                  <div style={{
                    display: 'flex',
                    flexDirection: 'column',
                    gap: '0.75rem',
                    marginBottom: '1.5rem'
                  }}>
                    <div style={{
                      display: 'flex',
                      justifyContent: 'space-between',
                      alignItems: 'center'
                    }}>
                      <span style={{
                        fontSize: '0.875rem',
                        color: '#64748b',
                        fontWeight: '500'
                      }}>
                        License Plate:
                      </span>
                      <span style={{
                        fontSize: '0.875rem',
                        fontWeight: '600',
                        color: '#0f172a',
                        fontFamily: 'monospace',
                        background: '#f1f5f9',
                        padding: '0.25rem 0.5rem',
                        borderRadius: '0.25rem'
                      }}>
                        {car.licensePlate}
                      </span>
                    </div>
                    <div style={{
                      display: 'flex',
                      justifyContent: 'space-between',
                      alignItems: 'center'
                    }}>
                      <span style={{
                        fontSize: '0.875rem',
                        color: '#64748b',
                        fontWeight: '500'
                      }}>
                        Mileage:
                      </span>
                      <span style={{
                        fontSize: '0.875rem',
                        fontWeight: '600',
                        color: '#0f172a'
                      }}>
                        {car.mileage.toLocaleString()} miles
                      </span>
                    </div>
                    {car.vin && (
                      <div style={{
                        display: 'flex',
                        justifyContent: 'space-between',
                        alignItems: 'center'
                      }}>
                        <span style={{
                          fontSize: '0.875rem',
                          color: '#64748b',
                          fontWeight: '500'
                        }}>
                          VIN:
                        </span>
                        <span style={{
                          fontSize: '0.75rem',
                          fontWeight: '500',
                          color: '#64748b',
                          fontFamily: 'monospace',
                          background: '#f1f5f9',
                          padding: '0.25rem 0.5rem',
                          borderRadius: '0.25rem',
                          maxWidth: '120px',
                          overflow: 'hidden',
                          textOverflow: 'ellipsis',
                          whiteSpace: 'nowrap'
                        }}>
                          {car.vin}
                        </span>
                      </div>
                    )}
                  </div>

                  {car.notes && (
                    <div style={{
                      marginBottom: '1.5rem',
                      padding: '0.75rem',
                      background: '#f8fafc',
                      borderRadius: '0.5rem',
                      border: '1px solid #e2e8f0'
                    }}>
                      <p style={{
                        fontSize: '0.875rem',
                        color: '#475569',
                        lineHeight: '1.5',
                        display: '-webkit-box',
                        WebkitLineClamp: 2,
                        WebkitBoxOrient: 'vertical',
                        overflow: 'hidden'
                      }}>
                        {car.notes}
                      </p>
                    </div>
                  )}

                  <div style={{
                    fontSize: '0.75rem',
                    color: '#94a3b8',
                    marginBottom: '1.5rem'
                  }}>
                    Added {formatDate(car.createdAt)}
                  </div>

                  {/* Action Buttons */}
                  <div style={{
                    display: 'flex',
                    gap: '0.5rem'
                  }}>
                    <Link
                      to={`/cars/${car._id}`}
                      className="btn btn-primary btn-sm"
                      style={{
                        flex: 1,
                        padding: '0.5rem 1rem',
                        fontSize: '0.75rem',
                        fontWeight: '600'
                      }}
                    >
                      View Details
                    </Link>
                    <Link
                      to={`/cars/${car._id}/edit`}
                      className="btn btn-outline btn-sm"
                      style={{
                        padding: '0.5rem 1rem',
                        fontSize: '0.75rem',
                        fontWeight: '600'
                      }}
                    >
                      Edit
                    </Link>
                    <button
                      onClick={() => handleDelete(car._id, `${car.make} ${car.model}`)}
                      className="btn btn-danger btn-sm"
                      style={{
                        padding: '0.5rem 1rem',
                        fontSize: '0.75rem',
                        fontWeight: '600'
                      }}
                    >
                      Delete
                    </button>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}

        {/* Stats Summary */}
        {cars.length > 0 && (
          <div style={{
            marginTop: '2rem',
            background: 'white',
            padding: '1.5rem',
            borderRadius: '0.75rem',
            boxShadow: '0 4px 6px -1px rgba(0, 0, 0, 0.1)',
            border: '1px solid #e2e8f0'
          }}>
            <div style={{
              display: 'grid',
              gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))',
              gap: '1rem',
              textAlign: 'center'
            }}>
              <div>
                <div style={{
                  fontSize: '2rem',
                  fontWeight: '700',
                  color: '#2563eb',
                  marginBottom: '0.25rem'
                }}>
                  {cars.length}
                </div>
                <div style={{
                  fontSize: '0.875rem',
                  color: '#64748b',
                  fontWeight: '500'
                }}>
                  Total Cars
                </div>
              </div>
              <div>
                <div style={{
                  fontSize: '2rem',
                  fontWeight: '700',
                  color: '#10b981',
                  marginBottom: '0.25rem'
                }}>
                  {uniqueColors.length}
                </div>
                <div style={{
                  fontSize: '0.875rem',
                  color: '#64748b',
                  fontWeight: '500'
                }}>
                  Different Colors
                </div>
              </div>
              <div>
                <div style={{
                  fontSize: '2rem',
                  fontWeight: '700',
                  color: '#f59e0b',
                  marginBottom: '0.25rem'
                }}>
                  {Math.round(cars.reduce((sum, car) => sum + car.mileage, 0) / cars.length).toLocaleString()}
                </div>
                <div style={{
                  fontSize: '0.875rem',
                  color: '#64748b',
                  fontWeight: '500'
                }}>
                  Avg Mileage
                </div>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Cars;
